import React from 'react';

function Modal({ content, id }) {
    return (
        <dialog className="modal" id={id}>
            <div className="modal-header">
                <button type="button" className="modal-close">X</button>
            </div>
            <div className="modal-content">
                {content}
            </div>
        </dialog>
    );
}

export default Modal;
